import './App.css';

import React, {Component} from 'react';
import SignUp from "./components/SignUp";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

class App extends Component {
  render() {
    return (
        <Router>

            <switch>
                <Route path="/" exact>

                </Route>
                <Route path="/SignUp">
                    <SignUp />
                </Route>
            </switch>
        </Router>
    );
  }
}

export default App;
